import React, { Component } from "react";
import Tabs from "react-bootstrap/Tabs";

class Navbar extends Component {
  constructor(props) {
    super(props);

    this.state = { hidden: false };

    this.showElement = this.showElement.bind(this);
  }

  render() {
    return (
      <Tabs justify variant="tabs" defaultActiveKey="background">
        <Tab eventKey="background" title="BACKGROUND"></Tab>
        <Tab eventKey="education" title="EDUCATION"></Tab>
        <Tab eventKey="experience">EXPERIENCE</Tab>
        <Tab eventKey="skills">SKILLS</Tab>
        <Tab eventKey="apps">SOFTWARE></Tab>
      </Tabs>
    );
  }
}

export default Navbar;
